import logo from './goldko.png';
import './App.css';
import Categories from './Categories'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
      </header>
      <Categories />
    </div>
  );
}

export default App;
